import React from 'react'
import { Container, Row, Col, Navbar, Nav } from 'react-bootstrap';
import {Link} from 'react-router-dom'

function Navigation() {
  return (
    <>
      <Container fluid>
      <Row>
        <Col xs={1} md={1} lg={1} xl={1} className="d-none d-md-block"></Col>
        <Col xs={12} md={10} lg={10} xl={10}>
        <h1 className="text-center text-7xl">J.</h1>

          <Navbar sticky="top" bg="white" variant="light">
            <Nav className="mx-auto">
              <Link to="/">New Arrivals</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Cast-and-Crew">Cast & Crew</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Women">Women</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Men">Men</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Boys-and-Girls">Boys & Girls</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Fragrances">Fragrances</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/Makeup">Makeup</Link>&nbsp;&nbsp;&nbsp;
              <Link to="/SkinCare">Skin Care</Link>&nbsp;&nbsp;&nbsp;
            </Nav>
          </Navbar>
        </Col>
        <Col xs={1} md={1} lg={1} xl={1} className="d-none d-md-block"></Col>
      </Row>
    </Container>
  </>
  )
}

export default Navigation
